import React, { useEffect, useState,  Component }  from 'react';


function Icon(props){


	return (
			<div 
				className={(props.type == "middle") ? "w-6 cursor-pointer flex mt-2 justify-center m-auto " : "w-6 cursor-pointer flex justify-center ml-2 mr-2 m-3"}
				onClick={() => {
						(props.param) ?
							props.click(props.param)
						:
							props.click();
							console.log("is undefined")

						}
				}>
				<img 
					src={props.source}
					className="transform duration-300 hover:scale-150"
					alt="plus"

					/>	
			</div>

	)


}


export default Icon;
